import React from 'react'
import Powerslap from './videos/video-2.mp4';

const BackgroundVideo = () => {
    return ( 
        <div>
            <video autoPlay loop muted>
                <source src= {Powerslap} type = "video/mp4"></source>
            </video>

        </div>

     );
}
 
export default BackgroundVideo;
